import React, { useState } from 'react';

const ExaDeAdmisRequAddPage = () => {
  const [year, setYear] = useState('');
  const [semester, setSemester] = useState('');
  const [course, setCourse] = useState('');
  const [batch, setBatch] = useState('');
  const [exam, setExam] = useState('');
  const [moduleName, setModuleName] = useState('');
  const [moduleID, setModuleID] = useState('');

  const handleSubmit = () => {
    // Your logic to handle form submission goes here
    // You can access all the form values from the state variables
    // For example: year, semester, course, etc.
    console.log('Form submitted!');
  };

  return (
    <div>
      <div>
        <label>Year:</label>
        <input type="text" value={year} onChange={(e) => setYear(e.target.value)} />
      </div>
      <div>
        <label>Semester:</label>
        <input type="text" value={semester} onChange={(e) => setSemester(e.target.value)} />
      </div>
      <div>
        <label>Course:</label>
        <input type="text" value={course} onChange={(e) => setCourse(e.target.value)} />
      </div>
      <div>
        <label>Batch:</label>
        <input type="text" value={batch} onChange={(e) => setBatch(e.target.value)} />
      </div>
      <div>
        <label>Exam:</label>
        <select value={exam} onChange={(e) => setExam(e.target.value)}>
          <option value="">Select Exam Type</option>
          <option value="end">End Exam</option>
          <option value="mid">Mid Exam</option>
        </select>
      </div>
      <div>
        <label>Module Name:</label>
        <input type="text" value={moduleName} onChange={(e) => setModuleName(e.target.value)} />
      </div>
      <div>
        <label>Module ID:</label>
        <input type="text" value={moduleID} onChange={(e) => setModuleID(e.target.value)} />
      </div>

      <div>
        <button onClick={handleSubmit}>Submit</button>
        <button>Preview</button>
        <button>Add</button>
        <button>Cancel</button>
      </div>
    </div>
  );
};

export default ExaDeAdmisRequAddPage;
